import { Box, Paper } from "@material-ui/core";
import React, { useState } from "react";

import { Form, Formik } from "formik";
import { UseRegister } from "../hooks/useForm";
import From1 from "./From1";
import From2 from "./From2";
import { useStyles } from "../hooks/Styles";

function FormRegister(props) {
  const { RegsiterSchema, registerValues } = UseRegister();
  const [pageId, setPageId] = useState(0); //numéro de page du formulaire d'inscription (0,1,2)
  const classes = useStyles();

  const GetFormContent = ({ formik }) => {
    switch (pageId) {
      case 0:
        return <From1 formik={formik} />;
      case 1:
        return <From2 formik={formik} />;

      default:
        break;
    }
  };
  const [Values, setValues] = useState(false);
  //   const handelFormik = (values)=>{
  //       setValues(values)

  //   }

  return (
    <Paper className={classes.IndexPanier} elevation={0}>
      <Formik
        className={classes.Form}
        initialValues={registerValues}
        validationSchema={RegsiterSchema}
      >
        {(formik) => {
          console.log("formik---------", formik.errors);

          return [
            <Form
              autoComplete="on"
              name="hotel"
              // className={classes.FormikHotelInfoForm}
            >
              {formik.errors.password &&  (
                <Box className={classes.errorBox}>
                  <Box
                    style={{
                      textAlign: "center",
                      fontWeight: "700",
                      marginBottom: 15,
                    }}
                  >
                    Attention
                  </Box>
                  <li> Les mots de passe ne correspondent pas.</li>
                  <li>
                    Vous devez avoir au moin un caractere alphanumérique (A-Z,
                    0-9).{" "}
                  </li>
                  <li>Votre mot de passe est trop court. </li>
                </Box>
              )}
                  {formik.errors.cfpassword &&  (
                <Box className={classes.errorBox}>
                  <Box
                    style={{
                      textAlign: "center",
                      fontWeight: "700",
                      marginBottom: 15,
                    }}
                  >
                    Attention
                  </Box>
                  <li> Les mots de passe ne correspondent pas.</li>
                  <li>
                    Vous devez avoir au moin un caractere alphanumérique (A-Z,
                    0-9).{" "}
                  </li>
                  <li>Votre mot de passe est trop court. </li>
                </Box>
              )}
              <GetFormContent formik={formik} />
            </Form>,
          ];
        }}
      </Formik>
    </Paper>
  );
}

export default FormRegister;
